"use strict";

const BinaryStoreError = require("./binarystore-error.js");

class ObjectNotFound extends BinaryStoreError {
  constructor(cause, message) {
    super(message || "Failed to update uuBinary. UuBinary was not found.", cause);
    this.code = `${BinaryStoreError.ERROR_PREFIX}objectNotFound`;
  }
}

module.exports = ObjectNotFound;
